"   <div class=\"lgnd\">",
"    Variation in the origin and course of the cystic artery. The cystic artery usually arises from the right hepatic artery. Variations in the origin and course of the cystic artery occur about 25 percent of people",
"    <sup>",
"     [1,2]",
"    </sup>",
"    , which is of clinical significance during surgical removal of the gallbladder.",
