"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F55850%7EPEDS%2F65129&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
